		$i = 0;
		foreach ($matches2 as $key) {
			preg_match($regexpPrices2, $key[1], $matches);
			$i++;
			//print_r($matches);
			if (strripos($key[1], 'Купить') === false) {
				$matches[3] = 0;
			} else {
				$matches[3] = preg_replace('~[\D]+~', '' , $matches[3]);
			}

			$matches[1] = 'https://'.ENGINE_CURR.trim($matches[1]);
			$matches[2] = strip_tags(trim($matches[2]));
			
			if ($matches[2] != false) {
				price_change_detect($matches[1], strip_tags($matches[2]), $matches[3], date("d.m.y-H:i:s"), 'manual', 'manual','manual', ENGINE_CURR, ENGINE_TYPE);
				$itemsArray[$matches[1]] = array(strip_tags($matches[2]), $matches[3], date("d.m.y-H:i:s"));
				AngryCurl::add_debug_msg($matches[1].' | '.strip_tags($matches[2]).' | '.$matches[3]);
